DROP TABLE IF EXISTS laravel.invoices;

CREATE TABLE laravel.invoices (
    id int NOT NULL,
    date date DEFAULT NULL,
    order_id int DEFAULT NULL,
    created_at datetime DEFAULT NULL,
    updated_at datetime DEFAULT NULL,
    CONSTRAINT pk_invoice PRIMARY KEY (id),
    CONSTRAINT fk_li_order FOREIGN KEY (order_id) REFERENCES laravel.orders (id)
);


